<!DOCTYPE html>
<html>
<head>
    <title>Crime Rankings by Country</title>
    <script src="https://cdn.plot.ly/plotly-latest.min.js"></script>

    <style>
        /* Remove font-family references to downloadable fonts and use system fonts */
        :root {
            --primary-color: #2196F3;
            --primary-dark: #1976D2;
            --background-color: #f5f5f5;
            --card-background: #ffffff;
            --text-color: #333333;
            --border-color: #e0e0e0;
        }

        body {
            margin: 0;
            padding: 0;
            font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', 
                         Roboto, Oxygen, Ubuntu, Cantarell, sans-serif;
            background-color: var(--background-color);
            color: var(--text-color);
        }

        /* Rest of the CSS remains the same */
        .container {
            max-width: 1400px;
            margin: 0 auto;
            padding: 24px;
        }

        .controls-card {
            background-color: var(--card-background);
            border-radius: 16px;
            padding: 24px;
            margin-bottom: 24px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .controls-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 20px;
            margin-bottom: 20px;
        }

        .control-group {
            display: flex;
            flex-direction: column;
            gap: 8px;
        }

        label {
            font-weight: 500;
            color: var(--text-color);
            font-size: 14px;
        }

        select {
            padding: 10px 16px;
            border: 2px solid var(--border-color);
            border-radius: 12px;
            font-size: 14px;
            outline: none;
            cursor: pointer;
            background-color: white;
            transition: all 0.2s ease;
        }

        select:hover, select:focus {
            border-color: var(--primary-color);
        }

        .button {
            padding: 10px 20px;
            border: none;
            border-radius: 12px;
            background-color: var(--primary-color);
            color: white;
            cursor: pointer;
            font-size: 14px;
            font-weight: 500;
            transition: all 0.2s ease;
            display: inline-flex;
            align-items: center;
            gap: 8px;
        }

        .button:hover {
            background-color: var(--primary-dark);
        }

        .button.outline {
            background-color: transparent;
            border: 2px solid var(--primary-color);
            color: var(--primary-color);
        }

        .button.outline:hover {
            background-color: var(--primary-color);
            color: white;
        }

        #rankingsTable table {
            width: 100%;
            border-collapse: collapse;
            margin-top: 20px;
        }

        #rankingsTable th,
        #rankingsTable td {
            padding: 12px;
            text-align: left;
            border-bottom: 1px solid var(--border-color);
        }

        #rankingsTable th {
            background-color: #f8f9fa;
            font-weight: 600;
        }

        #rankingsTable tbody tr:hover {
            background-color: #f8f9fa;
        }

        .rank-cell {
            font-weight: 600;
            color: var(--primary-color);
        }

        .value-cell {
            font-family: monospace;
            font-size: 14px;
        }

        #loadingOverlay {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-color: rgba(255, 255, 255, 0.8);
            display: flex;
            justify-content: center;
            align-items: center;
            z-index: 1000;
            visibility: hidden;
            opacity: 0;
            transition: all 0.3s ease;
        }

        #loadingOverlay.visible {
            visibility: visible;
            opacity: 1;
        }

        .spinner {
            width: 40px;
            height: 40px;
            border: 4px solid var(--border-color);
            border-top: 4px solid var(--primary-color);
            border-radius: 50%;
            animation: spin 1s linear infinite;
        }

        @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
        }
    </style>
</head>

            const toggleButton = document.getElementById('viewToggle');

            if (currentView === 'table') {
                tableDiv.style.display = 'none';
                chartDiv.style.display = 'block';
                toggleButton.innerHTML = '<i class="fas fa-table"></i> Switch to Table';
                currentView = 'chart';
            } else {
                tableDiv.style.display = 'block';
                chartDiv.style.display = 'none';
                toggleButton.innerHTML = '<i class="fas fa-chart-bar"></i> Switch to Chart';
                currentView = 'table';
            }
            updateRankings();
        }

        async function updateRankings() {
    showLoading();

    try {
        const year = parseInt(document.getElementById('yearSelect').value);
        const crimeType = document.getElementById('crimeTypeSelect').value;
        const sortOrder = document.getElementById('sortOrder').value;

        // Filter out entries with null or undefined Years
        let filteredData = crimeData.filter(d => d.Year === year && d !== null && d !== undefined);
        
        if (crimeType !== 'all') {
            filteredData = filteredData.filter(d => 
                d['Crime Type'] === crimeType && 
                d.Value !== null && 
                d.Value !== undefined && 
                !isNaN(d.Value)
            );
        } else {
            const countryTotals = {};
            filteredData.forEach(d => {
                if (!countryTotals[d.NAME]) {
                    countryTotals[d.NAME] = 0;  // Initialize with 0 instead of {total, count}
                }
                // Only add valid values
                if (d.Value !== null && d.Value !== undefined && !isNaN(d.Value)) {
                    countryTotals[d.NAME] += d.Value;  // Just add the values directly
                }
            });

            filteredData = Object.entries(countryTotals)
                .filter(([_, total]) => total > 0) // Only include countries with valid data
                .map(([country, total]) => ({
                    NAME: country,
                    Value: total,  // Use the total directly instead of calculating average
                    Year: year,
                    'Crime Type': 'All Crimes'
                }));
        }

        // Filter out any remaining invalid entries
        filteredData = filteredData.filter(d => 
            d.NAME && 
            d.Value !== null && 
            d.Value !== undefined && 
            !isNaN(d.Value)
        );

        // Sort data
        filteredData.sort((a, b) => {
            const valA = a.Value || 0;
            const valB = b.Value || 0;
            return sortOrder === 'desc' ? valB - valA : valA - valB;
        });

        if (currentView === 'table') {
            displayTableView(filteredData);
        } else {
            displayChartView(filteredData);
        }
    } catch (error) {
        console.error('Error updating rankings:', error);
        document.getElementById('rankingsTable').innerHTML = 
            '<div style="padding: 20px; color: #721c24; background-color: #f8d7da; border: 1px solid #f5c6cb; border-radius: 4px;">' +
            'An error occurred while updating the rankings. Please try again.</div>';
    } finally {
        hideLoading();
    }
}

function displayTableView(data) {
    try {
        const tableDiv = document.getElementById('rankingsTable');
        if (!data || data.length === 0) {
            tableDiv.innerHTML = '<div style="padding: 20px; text-align: center;">No data available for the selected criteria.</div>';
            return;
        }

        let html = `
            <table>
                <thead>
                    <tr>
                        <th>Rank</th>
                        <th>Country</th>
                        <th>Rate per 100,000</th>
                    </tr>
                </thead>
                <tbody>
        `;

        let rank = 1;
        data.forEach(d => {
            if (d && d.NAME && d.Value !== null && d.Value !== undefined && !isNaN(d.Value)) {
                html += `
                    <tr>
                        <td class="rank-cell">#${rank}</td>
                        <td>${d.NAME}</td>
                        <td class="value-cell">${d.Value.toFixed(2)}</td>
                    </tr>
                `;
                rank++;
            }
        });

        html += `
                </tbody>
            </table>
        `;

        tableDiv.innerHTML = html;
    } catch (error) {
        console.error('Error displaying table:', error);
        document.getElementById('rankingsTable').innerHTML = 
            '<div style="padding: 20px; color: #721c24; background-color: #f8d7da; border: 1px solid #f5c6cb; border-radius: 4px;">' +
            'An error occurred while displaying the data. Please try again.</div>';
    }
}

function displayChartView(data) {
    try {
        // Filter out invalid entries
        data = data.filter(d => 
            d && 
            d.NAME && 
            d.Value !== null && 
            d.Value !== undefined && 
            !isNaN(d.Value)
        );

        // Take top 20 for better visibility
        data = data.slice(0, 20);

        if (data.length === 0) {
            document.getElementById('rankingsChart').innerHTML = 
                '<div style="padding: 20px; text-align: center;">No data available for the selected criteria.</div>';
            return;
        }

        const trace = {
            x: data.map(d => d.Value),
            y: data.map(d => d.NAME),
            type: 'bar',
            orientation: 'h',
            marker: {
                color: '#2196F3',
                opacity: 0.8
            },
            text: data.map(d => d.Value.toFixed(2)),
            textposition: 'auto',
        };

        const layout = {
            title: {
                text: `Crime Rankings - ${document.getElementById('yearSelect').value}`,
                font: { size: 24 }
            },
            xaxis: {
                title: 'Rate per 100,000 inhabitants',
                tickfont: { size: 12 }
            },
            yaxis: {
                title: 'Country',
                tickfont: { size: 12 }
            },
            height: Math.max(400, data.length * 30),
            margin: { l: 150, r: 50, t: 50, b: 50 },
            plot_bgcolor: '#ffffff',
            paper_bgcolor: '#ffffff'
        };

        const config = {
            responsive: true,
            displayModeBar: true,
            displaylogo: false,
            modeBarButtonsToRemove: ['lasso2d', 'select2d']
        };

        Plotly.newPlot('rankingsChart', [trace], layout, config);
    } catch (error) {
        console.error('Error displaying chart:', error);
        document.getElementById('rankingsChart').innerHTML = 
            '<div style="padding: 20px; color: #721c24; background-color: #f8d7da; border: 1px solid #f5c6cb; border-radius: 4px;">' +
            'An error occurred while displaying the chart. Please try again.</div>';
    }
}

// Initialize when the page loads
document.addEventListener('DOMContentLoaded', () => {
    // Make sure styles are loaded before updating
    if (document.readyState === 'complete') {
        updateRankings();
    } else {
        window.addEventListener('load', updateRankings);
    }
});
    </script>
</body>
</html>
